declare namespace org {
    namespace apache {
        namespace catalina {
            namespace core {
                /**
                 * Adaptor to allow {@link FileItem} objects generated by the package renamed
                 * commons-upload to be used by the Servlet 3.0 upload API that expects
                 * {@link Part}s.
                 */
                // @ts-ignore
                class ApplicationPart extends java.lang.Object implements javax.servlet.http.Part {
                    // @ts-ignore
                    constructor(fileItem: org.apache.tomcat.util.http.fileupload.FileItem, location: java.io.File)
                    // @ts-ignore
                    public delete(): void
                    // @ts-ignore
                    public getContentType(): string
                    // @ts-ignore
                    public getHeader(name: java.lang.String | string): string
                    // @ts-ignore
                    public getHeaderNames(): Array<java.lang.String | string>
                    // @ts-ignore
                    public getHeaders(name: java.lang.String | string): Array<java.lang.String | string>
                    // @ts-ignore
                    public getInputStream(): java.io.InputStream
                    // @ts-ignore
                    public getName(): string
                    // @ts-ignore
                    public getSize(): number /*long*/
                    // @ts-ignore
                    public write(fileName: java.lang.String | string): void
                    // @ts-ignore
                    public getString(encoding: java.lang.String | string): string
                    // @ts-ignore
                    public getSubmittedFileName(): string
                }
            }
        }
    }
}
